INSERT INTO `episodes` VALUES ('0047a710-9d67-11ea-93fc-d9d46d7fad41','be743ef0-9c9b-11ea-a0d6-c73749625202','7','Loyauté','Ghost arrive à la conclusion que le responsable des attaques pourrait être un de ses amis. Au même moment, Angela apprend qu\'une nouvelle offensive se prépare et tente de l\'empêcher. Tasha rencontre pour la première fois la maîtresse de son mari. Au cours','KEmFZ4WeYa4Ab8XvD5kl.jpg','1',1,'local','2020-05-24 00:33:50','2020-05-24 00:34:13'),('00ae4100-83a7-11ea-9889-ddc4c2dd09c9','eaac9f90-83a6-11ea-a848-d19b2738261c','1','Pilote','Alors que la dernière mise à jour du jeu Mythic Quest est sur le point d’être lancée, le créateur Ian Grimm bloque sur un petit détail.','2QT50yCowSx1QOLHEZox.jpg','1',1,'local','2020-04-21 06:06:28','2020-04-21 06:08:44'),('00bc9c40-9265-11ea-b0c2-ab3dc18fe19e','8dc4f760-9190-11ea-bfe1-3bd48be6cc99','6','Les grands gagnants','Lors d’une croisière en Alaska, Ai, mère infatigable, se pose des questions sur son rôle de parent et sur son identité.','DvfyQUY8IyvdoUkg17zt.jpg','1',1,'local','2020-05-10 00:21:48','2020-05-10 00:22:41'),('0102d390-a996-11ea-85d7-7ff24f66a409','c61bc9b0-a926-11ea-87ab-d7afdcf419c4','5','La chambre noire','Jennifer mène l\'Armée des douze singes jusqu\'à la Chambre Noire. Cole est, lui, en 2043. Alors qu\'il se prépare à retourner dans le passé, le générateur qui alimente la machine à fragmentation est endommagé par une surtension. Le risque de fragmenter auss','BMijN7yhnwRi2u0QiLgH.jpg','1',1,'local','2020-06-08 12:40:31','2020-06-08 12:42:57'),('01abc590-8e65-11ea-95f6-857191ac98df','9085c120-8d8c-11ea-a297-59ddb9ac5c16','4','Ayaz','Rik organise un procès à la hâte pour décider du sort d\'Ayaz, Terenzio révèle des rumeurs sur un refuge de l\'OTAN, et le comportement de Mathieu inquiète Sylvie.','jgu9oAncSdkT2kopsYzL.jpg','1',1,'local','2020-05-04 22:11:45','2020-05-04 22:12:40'),('01accb50-8cbc-11ea-84fb-15e026d40888','c528a3c0-8bef-11ea-b919-616dd74f6096','6','Le traître','Frank étant bl