INSERT INTO `movies` VALUES ('000cd920-ae96-11ea-8518-23a1e7de70a9','The Dictator','L’histoire héroïque d’un dictateur qui va jusqu’à risquer sa vie pour s’assurer que son cher pays oppressé ne deviendra jamais une démocratie. Le film est inspiré du roman \"Zabibah et le Roi\" de Saddam Hussein.','Comédie',2012,'R',6.00,83.00,'https://www.youtube.com/watch?v=7kpFBkvt6Tc','local','NC1RQLYwMlpPSyawdA5l.jpg','maDQKAEX3X9OWOJbmLH1.jpg',10,1,'2020-06-14 21:23:05','2020-06-14 21:23:09'),('00240d80-aa50-11ea-8f0e-9752c021df24','Deadpool 2','Deadpool se voit contraint de rejoindre les X-Men : après une tentative ratée de sauver un jeune mutant au pouvoir destructeur, il est jeté en prison anti-mutants. Arrive Cable, un soldat venant du futur et ayant pour cible le jeune mutant, en quête de vengeance. Deadpool décide de le combattre. Peu convaincu par les règles des X-Men, il crée sa propre équipe, la « X-Force ». Mais cette mission lui réservera de grosses surprises, des ennemis de taille et des alliés indispensables.','Action, Comédie, Aventure',2018,'R',7.50,120.00,'https://www.youtube.com/watch?v=QPDNp1MvpgY','local','NwmFMhx39xbxPCrLKqzd.jpg','hDo3gxhbCTidMm6nC55H.jpg',16,1,'2020-06-09 10:51:56','2020-06-09 10:52:02'),('00a77f10-a32a-11ea-b77b-61e39808b4ce','Rambo III','Le Colonel Trautman contacte Rambo dans sa retraite en Thaïlande pour qu\'il l\'accompagne dans une mission périlleuse en Afghanistan. Mais l\'ex-soldat refuse afin de se consacrer aux moines bouddhistes qui l\'ont recueilli. Lorsque, quelques jours plus tard, l\'agent Griggs lui explique que Trautman a été capturé par le Colonel Zaysen, Rambo décide de sauver son ami. Il s\'infiltre dans les lignes ennemies et découvre toute l\'horreur du conflit qui oppose les moudjahidin à l\'armée soviétique. Déterminé, il s\'attaque à toute une armée sans oublier son objectif premier : récupérer Trautman.','Action, Aventure, Thriller, Guerre',1988,'R',6.00,100.00,'https://www.youtube.com/watch?v=44NUflhBLCw','local','olcIrTC6fHNuJTKSAJBH.jpg','yLMiDoBJuPhP1nZ2fdQK.jpg',12,1,'2020-05-31 08:32:18','2020-05-31 08:34:32'),('032f3900-a326-11ea-b4a3-412f1d3ccf7f','L\'Associé du Diable','Kevin Lomax, jeune et brillant avocat, est approché par l’un des plus puissants cabinets New-Yorkais dirigé par l’étrange John Milton. Assoiffé de pouvoir et d’argent, poussé par une ambition dévorante, prêt à tout pour réussir, il accepte l’offre et gravit les marches de la réussite de façon fulgurante. Mais l’ambition a un prix : sans le savoir, Kevin vient de vendre son âme au diable…','Drame, Mystère, Thriller, Fantastique, H',1997,'R',7.40,144.00,'https://www.youtube.com/watch?v=t0uptop3Zxs','local','3sjKclzs1Mu4MTw5cmb7.jpg','vySF6AAcrZaWjxmrcCN6.jpg',12,1,'2020-05-31 08:03:44','2020-05-31 08:09:02'),('045a4000-9322-11ea-a3c9-6109a8c2d3ef','Warning : Do not play','Une réalisatrice en difficulté tente désespérément d\'explorer la légende urbaine d\'un film tourné par un fantôme, au risque de sa vie.','Mystery',2019,'R',6.60,85.00,'https://www.youtube.com/watch?v=VPembis_9TM','local','p9AoU5MXkAgj81HCa2FB.jpg','PutRJ344aRr5KIRJpGEb.jpg',15,1,'2020-05-10 22:54:49','2020-05-10 22:55:07'),('056ac260-a370-11ea-8e8a-65645415863d','Dumb and Dumber','Après un malentendu à l\'aéroport, deux amis, Lloyd et Harry, spécialistes de l\'élevage de lombrics, partent à la recherche de Mary qui semble y avoir oubliée sa valise. Mais, ils se retrouvent au centre d\'un complot.','Comedy',1994,'PG-13',6.60,113.00,'https://www.youtube.com/watch?v=BjFhvuhpi00','local','yqAKG0b6uno8mjmPUIJ2.jpg','rUiUvyHphR05x7q0UaeX.jpg',12,1,'2020-05-31 16:53:31','2020-05-31 16:54:14'),('0648a0f0-821d-11ea-8179-fdd763846cae','Jumanji, Next Level','L’équipe est de retour, mais le jeu a changé. Alors qu’ils retournent dans Jumanji pour secourir l’un des leurs, ils découvrent un monde totalement inattendu. Des déserts arides aux montagnes enneigées, les joueurs vont devoir braver des espaces inconnus et inexplorés, afin de sortir du jeu le plus dangereux du monde...','Adventure',2019,'PG-13',6.90,123.00,'https://www.youtube.com/watch?v=3PyBBlkAcak','local','87arihZgM9TNPNZfNrot.jpg','ijuwEvT1QulpXCnPq3oU.jpg',10,1,'2020-04-19 07:06:15','2020-04-20 04:38:52'),('06cbe1f0-a444-11ea-be9a-f1e50b866716','Dumb & Dumber De','Vingt ans après, Lloyd et Harry sont toujours amis – et toujours aussi débiles ! Quand ils apprennent qu’Harry est père, les deux amis se lancent dans un nouveau road trip à la recherche de sa fille. Ils vont sillonner le pays à bord de véhicules toujours plus improbables, semant la folie et le chaos jusqu’à un endroit où ils n’auraient jamais dû pouvoir se retrouver…','Comédie',2014,'PG-13',5.50,109.00,'https://www.youtube.com/watch?v=vyFxIJy-N-s','local','tiSPSYZEvcVejhGrhKrU.jpg','PGTcPWz8IMwIa0yjC2gP.jpg',10,1,'2020-06-01 18:11:06','2020-06-01 18:11:11'),('070c1760-9978-11ea-b0af-6b66d1569448','L\'Empereur de Paris','Sous le règne de Napoléon, François Vidocq, le seul homme à s\'être échappé des plus grands bagnes du pays, est une légende des bas-fonds parisiens. Laissé pour mort après sa dernière évasion spectaculaire, l\'ex-bagnard essaye de se faire oublier sous les traits d\'un simple commerçant. Son passé le rattrape pourtant, et, après avoir été accusé d\'un meurtre qu\'il n\'a pas commis, il propose un marché au chef de la sûreté : il rejoint la police pour combattre la pègre, en échange de sa liberté. Malgré des résultats exceptionnels, il provoque l\'hostilité de ses confrères policiers et la fureur de la pègre qui a mis sa tête à prix...','History',2018,'PG-13',6.40,121.00,'https://www.youtube.com/watch?v=a7p3urtMM8U','local','JBYZ6vLMzpDgN2svurNH.jpg','3igu6JTif95TxrHZ2x1u.jpg',10,1,'2020-05-19 00:25:38','2020-05-19 00:36:02'),('078aba30-a3f9-11ea-b827-29a2c9f9befe','Fast and Furious 5','Depuis que Brian et Mia Toretto ont extirpé Dom des mains de la justice, ils ont dû franchir de nombreuses frontières pour échapper aux autorités. Retirés à Rio, ils sont contraints de monter un dernier coup pour se faire blanchir et recouvrer leur liberté. Ils se constituent une équipe d\'élite, réunissant les pilotes les plus avertis, conscients que leur seule chance d\'être acquittés pour bonne conduite nécessite une confrontation avec l\'homme d\'affaires véreux qui souhaite les voir morts. Mais il n\'est pas le seul à leurs trousses. L\'impitoyable agent fédéral Luke Hobbs n\'a jamais loupé sa cible. Affecté à la traque des fugitifs, lui et son équipe de choc élaborent un implacable dispositif d\'assaut destiné à les capturer. Passant le Brésil au crible, Hobbs réalise combien la frontière qui sépare les bons des méchants est ténue. Il doit alors s\'en remettre à son instinct pour acculer ses proies et éviter qu\'un autre ne les débusque avant lui.','Action, Thriller, Crime',2011,'PG-13',7.20,130.00,'https://www.youtube.com/watch?v=CYV-mTqlI_g','local','PPaIRpY2xmypMIl4ckvY.jpg','xjX4BEDnx9Wv0G2sApOH.jpg',12,1,'2020-06-01 09:14:15','2020-06-01 09:17:36'),('082c7c50-9185-11ea-a360-69bc29700dc6','Hell on the Border','Ce western épique et plein d\'action raconte l\'incroyable histoire vraie de Bass Reeves, le premier marschall noir du Far West. Après avoir échappé à l\'esclavage après la guerre civile, il arrive en Arkansas à la recherche d\'un emploi dans le domaine de la justice. Pour faire ses preuves, il doit traquer un hors-la-loi mortel avec l\'aide d\'un compagnon grisonnant. Alors qu\'il poursuit le criminel au plus profond de la nation Cherokee, Reeves doit non seulement esquiver les balles, mais aussi une discrimination sévère dans l\'espoir de gagner son étoile - et cimenter sa place de légende du Far West.','Western, Aventure',2019,'PG-13',5.60,106.00,'https://www.youtube.com/watch?v=87hB_ubXBbM','local','wr6uIoIeHcncVvK9olsX.jpg','UjPjg1ug43pt2LJ6Uje4.jpg',10,1,'2020-05-08 21:38:34','2020-05-08 21:38:47'),('08f5c4e0-a4d7-11ea-b501-e9b7f5152e57','Intuition','Pipa, inspectrice de police, travaille sur sa première grosse affaire tout en enquêtant sur son chef soupçonné de meurtre. Le préquel de \"Perdida\".','Thriller, Crime',2020,'R',5.80,116.00,'null','local','JU7hBNFQuvLoT6RsL6Xm.jpg','mFsKbLysOuBwqJZKFF07.jpg',16,1,'2020-06-02 11:43:26','2020-06-02 15:24:23'),('099057e0-821e-11ea-9179-7fb69c81a507','The Gentlemen','Quand Mickey Pearson, baron de la drogue à Londres, laisse entendre qu’il pourrait se retirer du marché, il déclenche une guerre explosive : la capitale anglaise devient le théâtre de tous les chantages, complots, trahisons, corruptions et enlèvements… Dans cette jungle où l’on ne distingue plus ses alliés de ses ennemis, il n’y a de la place que pour un seul roi !','Action, Crime, Com,die',2020,'R',7.80,113.00,'https://www.youtube.com/watch?v=8LbwEwJirvQ','local','v5IyG5YcfBA5QbL9UXBD.jpg','ysAJ34eQYgoPBR6Wexgl.jpg',16,1,'2020-04-19 07:13:30','2020-04-19 07:13:41'),('09a9e470-ae97-11ea-85cb-4b6a3ee28002','Twilight, chapitre 3 : Hésitation','Des morts suspectes dans les environs de Seattle laissent présager une nouvelle menace pour Bella. Victoria cherche toujours à assouvir sa vengeance contre elle et rassemble une armée. Malgré leur haine ancestrale, les Cullen et les Quileutes vont devoir faire une trêve et s\'associer pour avoir une chance de la sauver. Mais Bella est obligée de choisir entre son amour pour Edward et son amitié pour Jacob tout en sachant que sa décision risque de relancer la guerre entre les deux clans. Alors que l\'armée de Victoria approche, Bella est confrontée à la plus importante décision de sa vie.','Aventure, Fantastique, Drame, Romance',2010,'PG-13',6.10,124.00,'https://www.youtube.com/watch?v=vCWxYXIMkPQ','local','PA0TVXwj3m6aKTHbHF17.jpg','z5MZzeVNXEBXweBfhZuY.jpg',10,1,'2020-06-14 21:30:31','2020-06-14 21:30:34'),('0bb57aa0-ada4-11ea-a5e4-47e44741f6a6','Johnny English  contre-attaque','Une cyber-attaque révèle l’identité de tous les agents britanniques sous couverture. Johnny English devient alors le dernier espoir des services secrets. Rappelé de sa retraite, il plonge tête la première dans sa mission : découvrir qui est le génie du piratage qui se cache derrière ces attaques. Avec ses méthodes obsolètes Johnny English doit relever les défis de la technologie moderne pour assurer la réussite de sa mission.','Comédie',2018,'PG',6.20,89.00,'https://www.youtube.com/watch?v=X3DoHtJT2nw','local','HmDqEw14UHoNu05hRBWh.jpg','PRGlYfOahfZ3WAscAMaM.jpg',10,1,'2020-06-13 16:31:07','2020-06-13 16:31:11'),('0bf8c720-8143-11ea-9afb-179f1ebcd456','Bumblebee','1987 - Alors qu\'il est en fuite, l\'Autobot Bumblebee trouve refuge dans la décharge d\'une petite ville balnéaire de Californie. Il est découvert, brisé et couvert de blessures de guerre, par Charlie, une ado qui approche de ses 18 ans et cherche sa place dans le monde. Et quand elle le met en marche, elle se rend vite compte qu\'il ne s\'agit pas d\'une voiture jaune ordinaire.','Sci-Fi',2018,'PG-13',6.60,114.00,'https://www.youtube.com/watch?v=iBoc-Vi_2Js','local','bYWOOe7Y2AJl9VLHK1xt.jpg','aVHhEAQpgMKTtc0BDVkQ.jpg',13,1,'2020-04-18 05:05:55','2020-04-18 05:08:32'),('0c2a3620-8150-11ea-a8b7-e74ab2c45756','Joker','Dans les années 1980, à Gotham City, Arthur Fleck, un humoriste de stand-up raté, bascule dans la folie et devient le Joker.','Thriller',2019,'R',8.20,122.00,'https://www.youtube.com/watch?v=RumjcP_9vuo','local','weBxXKo0m3UpcUfyqP9k.jpg','05lCF8se6dqp5t6PW6P5.jpg',15,1,'2020-04-18 06:38:58','2020-04-18 06:39:15'),('0c7836c0-82d0-11ea-89a7-69fe9d1715bd','Spider-Man : Far from Home','Peter et ses amis passent leurs vacances d’été en Europe. Mais ils n’auront pas vraiment l’occasion de se reposer puisque Peter accepte d’aider Nick Fury pour débusquer les mystérieuses créatures qui sont la cause des catastrophes naturelles qui frappent le continent.','Action, Aventure, Science-Fiction',2019,'PG-13',7.50,129.00,'https://www.youtube.com/watch?v=ZTLUdti0MMs','local','gzXUm9wvIc4mevGo2HtN.jpg','z12XZhL6ro5Bv3XV8iY5.jpg',13,1,'2020-04-20 04:27:46','2020-04-20 04:27:51'),('0d6bc4c0-8c12-11ea-b4ae-db586956fdb0','Mensonges et trahisons','À sa mort, un vieil homme laisse sa fortune à sa nouvelle aide-soignante qui se retrouve entraînée dans une sombre histoire de tromperie et de meurtre. Pour survivre, elle devra remettre en cause les motivations de chacun, y compris de son entourage.','Thriller',2020,'PG-13',6.50,96.00,'null','local','GSGhkbgFobkvQ4bQCI9r.jpg','XyxfqadTak2Ul4vkSvxU.jpg',16,1,'2020-05-01 23:12:55','2020-05-01 23:13:14'),('0dab4340-ac02-11ea-bb69-292ed50d85ee','Bad Boys II','Les policiers Marcus Burnett et Mike Lowrey enquêtent sur Tapia, un ambitieux baron de la drogue décidé à tout pour inonder Miami d\'un nouveau poison et accroître son empire. Au cours de leurs investigations, ils se voient épaulés par Syd, la soeur de Marcus, également agent de la D.E.A. (Drug Enforcement Agency). Mike s\'éprendra de la demoiselle, provoquant ainsi quelques tensions entre lui et son partenaire...','Aventure, Action, Comédie, Thriller, Cri',2003,'R',6.50,147.00,'https://www.youtube.com/watch?v=AURhd5TCG6U','local','z2FUCIBthb73RKuiiaxi.jpg','b8mmsKXbSFJFctVhHieB.jpg',12,1,'2020-06-11 14:39:00','2020-06-11 14:39:05'),('0f2f8ef0-8142-11ea-9ab1-c3c8b69701c8','Astérix Le Secret de la Potion','À la suite d’une chute lors de la cueillette du gui, le druide Panoramix décide qu’il est temps d’assurer l’avenir du village. Accompagné d’Astérix et Obélix, il entreprend de parcourir le monde gaulois à la recherche d’un jeune druide talentueux à qui transmettre le Secret de la Potion Magique…','Animation, Familial, Com,die, Aventure',2018,'G',6.90,85.00,'https://www.youtube.com/watch?v=k8eAW7agoPA','local','a5E3Nbdg34d6xcnwVa9Y.jpg','XAEucCVhPNLLauNfsy1I.jpg',14,1,'2020-04-18 04:58:51','2020-04-26 18:56:29'),('13333e00-b02c-11ea-8739-1914c7e64cd8','Tom et Jerry - Retour à Oz','Après avoir vaincu la Méchante sorcière à Oz, Tom et Jerry sont de retour au Kansas avec Dorothy ! Mais pas pour longtemps : un tout nouveau méchant surgit de ce monde magique - Le Roi Gnome ! En effet, après avoir capturé la Bonne Sorcière, le Roi Gnome et son armée sont en train de détruire Oz et il ne leur manque qu\'on objet pour contrôler la Cité d\'Emeraude : les souliers rouges de Dorothy. C\'est donc à notre chat et notre souris favoris de retourner à Oz et de sauver le monde qu\'ils aiment tant.','Animation, Familial',2016,'G',6.10,80.00,NULL,'local','iMLvxrzSzu8KlI0ckmyM.jpg','0vFQeXAseRcXmnA3N9oV.jpg',14,1,'2020-06-16 21:49:53','2020-06-16 21:49:58'),('15a3f3d0-8221-11ea-8f74-ab56792663bf','Invisible Man','Cecilia Kass est en couple avec un brillant et riche scientifique. Ne supportant plus son comportement violent et tyrannique, elle prend la fuite une nuit et se réfugie auprès de sa sœur, leur ami d\'enfance et sa fille adolescente. Mais quand l\'homme se suicide en laissant à Cecilia une part importante de son immense fortune, celle-ci commence à se demander s\'il est réellement mort. Tandis qu\'une série de coïncidences inquiétantes menace la vie des êtres qu\'elle aime, Cecilia cherche désespérément à prouver qu\'elle est traquée par un homme que nul ne peut voir. Peu à peu, elle a le sentiment que sa raison vacille…','Horror,Thriller',2020,'R',7.20,125.00,'https://www.youtube.com/watch?v=7biiwa5DfFg','local','j9oXJzaBe6h7zd3ln9E3.jpg','kLvP4GdnWKZ1P0fWJxKV.jpg',13,1,'2020-04-19 07:35:19','2020-04-19 07:35:41'),('15e6c180-8208-11ea-a145-8f9104f0d3e8','The Informer','Un détenu est forcé de participer à une opération menée par le FBI au coeur de la prison. Une fois la mission menée à bien, l\'agence fédérale lâche son agent de circonstance. L\'homme n\'a alors plus d\'autre choix que de s\'évader.','Thriller',2019,'R',6.40,109.00,'https://www.youtube.com/watch?v=vaXqd0Q2U1A','local','tlWrlSpNJ0GMcerFS60M.jpg','b7S8Lxvfh2emftkTYJzP.jpg',15,1,'2020-04-19 04:36:22','2020-04-19 04:36:33'),('182e7a10-a76d-11ea-aa7a-b1450b075d50','The Last Days of American Crime','Dans un avenir pas trop lointain, où en réponse finale au crime et au terrorisme, le gouvernement américain prévoit de diffuser un signal qui empêchera quiconque de sciemment enfreindre la loi.','Action, Crime, Thriller',2020,'R',4.30,148.00,NULL,'local','iQK1LHUZbJvOzpg5HrEj.jpg','PSjhokldKnSBeTmc9TRu.jpg',16,1,'2020-06-05 18:42:38','2020-06-05 18:42:43'),('18f74d00-9bc1-11ea-b108-d757456de9a8','The Way Back','Une star du basketball a perdu sa femme et sa famille à cause de son addiction. Il a l\'espoir de trouver sa salvation en devenant le coach d\'une équipe de basketball d\'un lycée qui ne compte aucune victoire à son actif.','Drama',2020,'R',6.70,108.00,'null','local','Ddj7JvQn4MvvLZqmaru3.jpg','A06tp21nAHhZ1YpcO8HF.jpg',15,1,'2020-05-21 22:13:43','2020-05-21 22:21:18'),('1a4d0c70-9978-11ea-a7ef-1549851dd19d','En liberté !','Yvonne, jeune inspectrice de police, découvre que son mari, le capitaine Santi, héros local tombé au combat, n’était pas le flic courageux et intègre qu’elle croyait, mais un véritable ripou. Déterminée à réparer les torts commis par ce dernier, elle va croiser le chemin d’Antoine, injustement incarcéré par Santi pendant huit longues années. Une rencontre inattendue et folle qui va dynamiter leurs vies à tous les deux.','Comedy',2018,'PG-13',6.00,107.00,'https://www.youtube.com/watch?v=2egqGEocpcA','local','bds0ZJOt3UgMwC9JZb9a.jpg','9Dns6IiguXjykIb2p7VA.jpg',10,1,'2020-05-19 00:26:10','2020-05-19 00:36:02'),('1ae61e30-8209-11ea-92ac-01ba66c7cd5e','U-235','En pleine Seconde Guerre mondiale, une équipe de résistants sans foi ni loi embarque a bord d\'un sous-marin allemand. Sa mission : apporter l’uranium nécessaire au projet Manhattan du Congo belge à New York. Mais quand l’ennemi allemand se dresse sur leur route c’est l’avenir de l’humanité entière qui se joue.','Action, Comédie, Histoire, Aventure, Gue',2019,'R',7.70,102.00,'https://www.youtube.com/watch?v=b-bwCfMBYZI','local','D4eZMQva3DihiPBD2iWS.jpg','nKw3SqyI2xHuXLVLMReG.jpg',15,1,'2020-04-19 04:43:40','2020-04-19 04:43:46'),('1b03b880-8251-11ea-b7b3-170939e8560f','Charlie\'s Angels','Les Charlie’s Angels ont toujours assuré la sécurité de leurs clients grâce à leurs compétences hors du commun. L’agence Townsend a maintenant étendu ses activités à l’international, avec les femmes les plus intelligentes, les plus téméraires et les mieux entraînées du monde entier – de multiples équipes de Charlie’s Angels affrontant les missions les plus périlleuses, chacune guidée par son propre Bosley.','Action, Aventure, Com,die',2019,'PG-13',6.50,119.00,'https://www.youtube.com/watch?v=nqdiwrUg2d4','local','uWWezxTcMFhCisF07al6.jpg','jR25BExuctXg1t1tT641.jpg',16,1,'2020-04-19 13:19:04','2020-04-19 13:19:27'),('1c270d20-94b9-11ea-8b38-b339a76c65a8','The Strangers','La vie d’un village coréen est bouleversée par une série de meurtres, aussi sauvages qu’inexpliqués, qui frappe au hasard la petite communauté rurale.  La présence, récente, d’un vieil étranger qui vit en ermite dans les bois attise rumeurs et superstitions.  Face à l’incompétence de la police pour trouver l’assassin ou une explication sensée, certains villageois demandent l’aide d’un chaman.  Pour Jong-gu aussi , un policier dont la famille est directement menacée, il est de plus en plus évident que ces crimes ont un fondement surnaturel…','Mystery',2016,'R',7.30,146.00,'https://www.youtube.com/watch?v=vMapqiPeioM','local','VMbwt2fgtTT5S6szzmgs.jpg','JAb2Li5rjlniQbqLAoHX.jpg',15,1,'2020-05-12 23:28:55','2020-05-12 23:29:11'),('1c5d3320-a325-11ea-9548-d97ab41c6e2f','Le Parrain : 3ème partie','A l\'âge du bilan, Michael Corléone tente de se réhabiliter auprès des siens et de la société. Mais les autres Familles de la Mafia lui déclarent à  nouveau la guerre. Vincent Mancini, son neveu, se range à ses côtés pour régler les comptes.','Drama',1990,'R',7.40,160.00,'https://www.youtube.com/watch?v=kCAcWDDPdNY','local','kLoLDV019qGURQIMqNtj.jpg','teFYL6pE1Z5naRH36fXE.jpg',12,1,'2020-05-31 07:57:17','2020-05-31 08:10:57'),('1cc14aa0-931a-11ea-9f9b-9bf200c2781d','Manhattan Lockdown','Une course-poursuite infernale pour appréhender deux tueurs de flics à New York. L’inspecteur Davis est prêt à tout pour les coincer, d’autant qu’une gigantesque machination se dessine derrière leurs agissements. Pour les piéger, il va complètement isoler l’île de Manhattan, fermant l’ensemble de ses ponts, dans une spectaculaire opération… La traque peut commencer.','Crime, Action, Drame',2019,'R',6.70,101.00,'https://www.youtube.com/watch?v=uSYGcxPHlRU','local','sdH5kL1FZHZFbHBThwFi.jpg','dQYpKCvcIPtGAoCxebBq.jpg',16,1,'2020-05-10 21:58:14','2020-05-10 21:58:22'),('1ed30020-b02a-11ea-bdf7-27fc55a91886','Le Traître','Au début des années 80, la guerre entre les parrains de la mafia sicilienne est à son comble. Tommaso Buscetta, membre de Cosa Nostra, fuit son pays pour se cacher au Brésil. Pendant ce temps, en Italie, les règlements de comptes s’enchaînent, et les proches de Buscetta sont assassinés les uns après les autres. Arrêté par la police brésilienne puis extradé, Buscetta, prend une décision qui va changer l’histoire de la mafia: rencontrer le juge Falcone et trahir le serment fait à Cosa Nostra.','Thriller',2019,'R',7.80,151.00,'https://www.youtube.com/watch?v=QT8Hj3yYFLI','local','RVQskZ2nF7ZOEnXgyBXv.jpg','YFw1PePnuzmSZZNV1TBo.jpg',15,1,'2020-06-16 21:35:54','2020-06-16 21:36:12'),('200e6da0-8205-11ea-a883-8b131903ba96','Pokémon Detective Pikachu','Harry Goodman, un détective privé disparait mystérieusement. Une séparation qui pousse alors son fils Tim, 21 ans, à tenter de découvrir ce qui s’est passé.  Le détective Pikachu, ancien partenaire de Harry, participe alors à l’enquête...','Family,Fantasy',2019,'PG',6.90,104.00,'https://www.youtube.com/watch?v=EGJxKLR3S5M','local','Dxn6mkd1ygVZFaWqxmj7.jpg','idUsPYVrgaBaiPkQNXER.jpg',13,1,'2020-04-19 04:15:11','2020-04-19 04:15:27'),('20dac780-ac00-11ea-9fef-933c4241e4c6','Little Man','Calvin Sims est un voleur aussi petit que redoutable. Sa taille de bébé lui a permis d\'accomplir les coups les plus incroyables, mais ne l\'a jamais empêché de se faire respecter en prison... Tout juste libéré sur parole, Calvin est décidé à se retirer après un dernier vol, mais les choses se compliquent sévèrement. Pour échapper à la police, il n\'a pas d\'autre choix que de cacher l\'énorme diamant qu\'il vient de subtiliser dans le sac d\'une jeune inconnue, Vanessa.Récupérer le précieux joyau va s\'avérer beaucoup plus difficile que de le voler. Grâce à sa petite taille, Calvin se fait passer pour un enfant abandonné... et le voilà qui atterrit chez Vanessa et Darryl, un jeune couple qui hésitait justement à avoir un enfant. Emus et touchés par la détresse de celui qu\'ils prennent pour un petit être innocent, ils vont avoir l\'occasion de tester le rôle de parents...','Comédie, Crime',2006,'PG-13',5.70,90.00,NULL,'local','9CRy5BVLmOOB8XDnmjho.jpg','iHocuQ8V3hrXPeX4thZP.jpg',10,1,'2020-06-11 14:25:13','2020-06-11 14:25:19'),('22a7efb0-ac27-11ea-99cb-8320517f0d4e','Django Unchained','Dans le sud des États-Unis, deux ans avant la guerre de Sécession, le Dr King Schultz, un chasseur de primes allemand, fait l’acquisition de Django, un esclave qui peut l’aider à traquer les frères Brittle, les meurtriers qu’il recherche. Schultz promet à Django de lui rendre sa liberté lorsqu’il aura capturé les Brittle – morts ou vifs.  Alors que les deux hommes pistent les dangereux criminels, Django n’oublie pas que son seul but est de retrouver Broomhilda, sa femme, dont il fut séparé à cause du commerce des esclaves…  Lorsque Django et Schultz arrivent dans l’immense plantation du puissant Calvin Candie, ils éveillent les soupçons de Stephen, un esclave qui sert Candie et a toute sa confiance. Le moindre de leurs mouvements est désormais épié par une dangereuse organisation de plus en plus proche… Si Django et Schultz veulent espérer s’enfuir avec Broomhilda, ils vont devoir choisir entre l’indépendance et la solidarité, entre le sacrifice et la survie…','Western',2012,'R',8.10,165.00,'https://www.youtube.com/watch?v=K2XjgsfzDrU','local','wVPffuqw2pjM6BuzFXTa.jpg','aI5UzYS7AAIPq9HzPgU2.jpg',15,1,'2020-06-11 19:04:27','2020-06-11 19:05:10'),('252b1120-aa67-11ea-9d02-531815446caf','Le Noël givré de l\'Âge de glace','Laissez de la place sous votre sapin pour un Noël Mammouth ! Vos héros préférés sont de retour pour Noël, un rendez-vous à ne pas manquer...','Animation, Familial, Téléfilm',2011,'G',6.20,26.00,NULL,'local','RZMxMSGRioraWNQnvcWw.jpg','lShOopG8dfXhBq1RqrIH.jpg',14,1,'2020-06-09 13:37:37','2020-06-09 13:37:40'),('259958a0-a9af-11ea-92a2-190a86d868f8','Thor : Ragnarok','Thor est emprisonné de l’autre côté de l’univers sans son puissant marteau et se retrouve engagé dans une course contre le temps pour rejoindre Asgard et arrêter Ragnarok – la destruction de son monde natal et la fin de la civilisation Asgardienne – des mains d’une toute nouvelle menace, l’impitoyable Hela. Mais d’abord, il doit survivre à une compétition meurtrière de gladiateurs qui l’oppose à son ancien allié et compagnon Avenger – l’Incroyable Hulk !','Action, Aventure, Comédie, Fantastique',2017,'PG',7.60,130.00,'https://www.youtube.com/watch?v=hQTojPgplVA','local','Zexb4Usdj9Iq6gfSoreV.jpg','4xx1YXg0MVmaKqA1Kke9.jpg',10,1,'2020-06-08 15:40:30','2020-06-08 15:40:35'),('25fac8a0-aa54-11ea-9745-09a1ae39ea60','Bad Boys','Si Mike Lowrey est un séducteur invéteré, héritier d\'une fortune et policier par passion, son collègue et ami Marcus Burnett est un homme rangé, marié et père de famille. Leur amitié ne les empêche pas d\'avoir des méthodes parfaitement différentes. Mais la disparition de cent kilos d\'héroine, dérobés dans les locaux mêmes de la brigade des stups, va leur faire oublier leur concept sur la façon d\'exercer leur métier, pour se lancer a la poursuite des voleurs.','Action, Comédie, Crime, Thriller',1995,'R',6.70,120.00,'https://www.youtube.com/watch?v=tL0M9JPKSL0','local','miuY2slB7DRvXbS0UNhN.jpg','YCDMKycdBxfI5WRaC8nL.jpg',12,1,'2020-06-09 11:21:37','2020-06-09 11:21:41'),('276d82b0-a3f7-11ea-a4c2-cb687e39a3de','Les Évadés','En 1947, Andy Dufresne, un jeune banquier, est condamné à la prison à vie pour le meurtre de sa femme et de son amant. Ayant beau clamer son innocence, il est emprisonné à Shawshank, le pénitencier le plus sévère de l’État du Maine. Il y fait la rencontre de Red, un noir désabusé, détenu depuis vingt ans. Commence alors une grande histoire d\'amitié entre les deux hommes...','Drama',1994,'R',8.70,140.00,'https://www.youtube.com/watch?v=45Sss4oNd5k','local','acAr5aK8D1ysIfrovoR7.jpg','qx3c4cTSqAPm0M92hz5H.jpg',12,1,'2020-06-01 09:00:50','2020-06-01 09:07:24'),('27930940-816a-11ea-87bb-4fad3d780187','Shazam!','On a tous un super-héros qui sommeille au fond de soi… il faut juste un peu de magie pour le réveiller. Pour Billy Batson, gamin débrouillard de 14 ans placé dans une famille d\'accueil, il suffit de crier \"Shazam !\" pour se transformer en super-héros. Ado dans un corps d\'adulte sculpté à la perfection, Shazam s\'éclate avec ses tout nouveaux superpouvoirs. Est-il capable de voler ? De voir à travers n\'importe quel type de matière ? De faire jaillir la foudre de ses mains ? Et de sauter son examen de sciences sociales ? Shazam repousse les limites de ses facultés avec l\'insouciance d\'un enfant. Mais il lui faudra maîtriser rapidement ses pouvoirs pour combattre les forces des ténèbres du Dr Thaddeus Sivana…','Action, Comédie, Fantastique',2019,'PG-13',7.00,132.00,'https://www.youtube.com/watch?v=67qvKdn-2Wo','local','7kfvi4XX694SRu3IQ851.jpg','VDaf0qp16eMatHD9V9Cz.jpg',13,1,'2020-04-18 09:45:51','2020-04-18 09:45:57'),('2854b320-8207-11ea-9d79-1d8b036e5a49','Jojo Rabbit','Jojo est un petit allemand solitaire. Sa vision du monde est mise à l’épreuve quand il découvre que sa mère cache une jeune fille juive dans leur grenier. Avec la seule aide de son ami aussi grotesque qu\'imaginaire, Adolf Hitler, Jojo va devoir faire face à son nationalisme aveugle.','Comedy',2019,'PG-13',8.20,108.00,'https://www.youtube.com/watch?v=_d6Q4-H1_ds','local','fXA4eeOkEsEq2c0fRkVO.jpg','n27XfK5pQTMnlhaAYeIp.jpg',10,1,'2020-04-19 04:29:44','2020-04-19 04:29:56'),('2964b5e0-a32a-11ea-922e-53934d3eeba4','John Rambo','John Rambo s\'est retiré dans le nord de la Thaïlande, où il mène une existence simple dans les montagnes et se tient à l\'écart de la guerre civile qui fait rage non loin de là, sur la frontière entre la Thaïlande et le Myanmar. Il pêche et capture des serpents venimeux pour les vendre.La violence du monde le rattrape lorsqu\'un groupe de volontaires humanitaires mené par Sarah et Michael Bennett vient le trouver pour qu\'il les guide jusqu\'à un camp de réfugiés auquel ils veulent apporter une aide médicale et de la nourriture. Rambo finit par accepter et leur fait remonter la rivière, vers l\'autre côté de la frontière. Deux semaines plus tard, le pasteur Arthur Marsh lui apprend que les volontaires ne sont pas revenus et que les ambassades refusent de l\'aider à les retrouver. Rambo sait mieux que personne ce qu\'il faut faire dans ce genre de situation...','Action, Thriller',2008,'R',6.50,90.00,'https://www.youtube.com/watch?v=VIsY2k-Up4E','local','DOtXvlpTnaI4zJXgwb7E.jpg','moEWb3eKVC9y87XnqfzZ.jpg',12,1,'2020-05-31 08:33:26','2020-05-31 08:34:32'),('2b045120-8220-11ea-8350-9f48236b870d','Sonic le film','L\'histoire du hérisson bleu le plus rapide du monde qui arrive sur Terre, sa nouvelle maison. Sonic et son nouveau meilleur ami Tom font équipe pour sauver la planète du diabolique Dr. Robotnik, bien déterminé à régner sur le monde entier.','Action, Science-Fiction, Comédie, Famili',2020,'PG',7.60,100.00,'https://www.youtube.com/watch?v=90jWJnatsuI','local','ks7Vo0bb83dVEUpd8CiP.jpg','yITPJ4CcBFYJKEx8gTaZ.jpg',14,1,'2020-04-19 07:28:46','2020-04-19 07:28:50'),('2fe572f0-8206-11ea-930e-1b114f4d316f','Star Wars : L\'Ascension de Skywalker','Lucasfilm et le réalisateur J.J. Abrams unissent de nouveau leurs forces pour embarquer le spectateur d