cal, et commet ses premiers délits. Arrêté et interrogé, il refuse de parler et gagne ainsi le respect du milieu. A sa sortie de prison, il fait la connaissance de James Conway et de Tommy DeVito, deux truands d\'une extrême violence, et se lance avec eux dans des trafics de grande envergure. Karen, une jeune bourgeoise qu\'il courtise et finit par épouser, ne devine sa profession qu\'après être passée devant l\'officier d\'état-civil. Grisé par le succès, Henry multiplie les coups les plus audacieux...','Drama',1990,'R',8.40,141.00,'https://www.youtube.com/watch?v=xFxgu0ScjJ0','local','xFq25ApLqy7I1ctocM3c.jpg','mQkmHtkifTGnUGRWGTzt.jpg',12,1,'2020-05-31 08:15:39','2020-05-31 08:15:54'),('ae89af80-9977-11ea-be8c-a3d9f4da2953','Green Book  Sur les routes','En 1962, alors que règne la ségrégation, Tony Lip (Viggo Mortensen), un videur italo-américain du Bronx, est engagé pour conduire et protéger le Dr Don Shirley (Mahershala Ali), un pianiste noir de renommée mondiale, lors d’une tournée de concerts. Durant leur périple de Manhattan jusqu’au Sud profond, ils s’appuient sur le Green Book pour dénicher les établissements accueillant les personnes de couleur, où l’on ne refusera pas de servir Shirley et où il ne sera ni humilié ni maltraité. Dans un pays où le mouvement des droits civiques commence à se faire entendre, les deux hommes vont être confrontés au pire de l’âme humaine, dont ils se guérissent grâce à leur générosité et leur humour. Ensemble, ils vont devoir dépasser leurs préjugés, oublier ce qu’ils considéraient comme des différences insurmontables, pour découvrir leur humanité commune.','Drama',2018,'PG-13',8.30,130.00,'https://www.youtube.com/watch?v=A8hiyKiLTL4','local','Mi3MrqJwo6v1jNjqPGNf.jpg','MnH5iwtrkoP4nmUjn3g3.jpg',15,1,'2020-05-19 00:23:09','2020-05-19 00:36:02'),('af0d9690-8220-11ea-bd27-995ae773a193','Escape From Pretoria','L\'histoire vraie de l\'incarcération et de l\'évasion de deux activistes anti-Apartheid, Tim Jenkin et Stephen Lee, en Afrique du Sud en 1978. Incarcérés dans la prison de sécurité maximale de Pretoria, ils décident d\'envoyer un message clair au gouvernement et de s\'échapper !','History',2020,'PG-13',6.60,102.00,'null','local','AtimTh6aBy3Kwa4TSscA.jpg','wRv9OlX0ushSdj8ALgnV.jpg',15,1,'2020-04-19 07:32:27','2020-04-19 07:32:37'),('b07c9830-a3f7-11ea-a215-b1fbe94c1691','xXx','Après une série de tests, Xander Cage dit « xXx », un spécialiste des sports extrêmes couvert de tatouages, est recruté par Augustus Gibbons, un agent de la National Security Agency (NSA), pour s\'infiltrer dans une organisation criminelle et mettre fin à ses agissements. Dirigée par un certain Yorgi, celle-ci se fait appeler « Anarchie 99 » et son siège se situe à Prague, en République tchèque. Gibbons est persuadé que Xander Cage réussira là où les espions conventionnels ont échoué.Ce dernier insiste toutefois pour accomplir cette mission à sa façon. Il se présente alors directement à Yorgi et se lie rapidement d\'amitié avec lui, l\'occasion pour Xander Cage de découvrir les terribles desseins de l\'organisation.','Action, Aventure, Thriller',2002,'R',5.90,124.00,'https://www.youtube.com/watch?v=Ybidzwu1_dM','local','DAIVJqu06AFOM6LNqcnp.jpg','eda6djblw01mTCWs1hbi.jpg',12,1,'2020-06-01 09:04:40','2020-06-01 09:07:24'),('b0974900-a759-11ea-94e0-eba850d18259','Higher Power','Depuis la mort de sa femme, Joseph Steadman a tout perdu : son emploi, sa maison, ses enfants. Ne reste que la colère, qui le ronge et le détruit. Mais quelque part, une mystérieuse organisation le surveille. Sans le savoir, Joseph est porteur d’un génome unique, clef de notre prochain stade d’évolution. Prête à tout pour repousser les limites de la science, l’organisation kidnappe sa fille pour le contraindre à participer à une expérience. Malgré la haine qui s’empare de lui, Joseph n’a d’autre choix que d’accepter. Il est alors exposé à de puissants rayons qui libèrent en lui un immense pouvoir. Assoiffé de vengeance, Joseph ne sait pas 