'),('c44b57b0-989f-11ea-a5ff-19ccd7621c4b','Inséparables','Mika, un petit escroc, a fait un rapide tour en prison, où il a fait la connaissance de « Poutine », un détenu cinglé et imprévisible. Sitôt sa peine purgée, il décide de repartir à zéro et de refaire sa vie. Alors qu’il s’apprête à épouser la fille d’un riche homme d’affaires, son passé le rattrape : Poutine débarque sans prévenir ! Mika va vite réaliser qu’on ne se débarrasse pas aisément d’un tel boulet...','Comedy',2019,'PG-13',6.20,97.00,'https://www.youtube.com/watch?v=GCTwc_dpzYg','local','jOiHoaRrYtqu7ZqePcEr.jpg','bSaMUSTMMHyezOty0pXg.jpg',10,1,'2020-05-17 22:37:34','2020-05-17 22:38:06'),('c51ebe60-8223-11ea-af15-b31974ebe761','Le prince oublié','Sofia, 8 ans, vit seule avec son père. Tous les soirs, il lui invente une histoire pour l’endormir. Ses récits extraordinaires prennent vie dans un monde imaginaire où l’héroïne est toujours la princesse Sofia, et son père, le Prince courageux. Mais trois ans plus tard, quand Sofia rentre au collège, elle n’a plus besoin de ces histoires. Désarmé, son père va devoir accepter que sa fille grandisse et s’éloigne de lui. Dans leur Monde imaginaire, le Prince va alors devoir affronter la plus épique de toutes ses aventures pour conserver une place dans l’histoire.','Adventure',2020,'PG',5.40,101.00,'https://www.youtube.com/watch?v=ZMbY7zK9wOo','local','4fMln4XYZaMLy4hYzgdk.jpg','TtOtEhOfthrEA88xyFlp.jpg',10,1,'2020-04-19 07:54:33','2020-04-20 04:40:51'),('c5355450-a325-11ea-a1bc-47580df8f83a','Le Saint','Refusant l\'identité que lui impose l\'orphelinat de Hong Kong où il est placé, un jeune garçon prend la fuite. Devenu adulte, sous l\'identité de Simon Templar il se signale par ses talents de voleur. Ses dons aux bonnes œuvres lui valent son surnom : « Le Saint ». Il décide d\'assurer sa retraite en vendant la formule de fission à froid à Ivan Tretiak, un homme d\'affaires russe qui rêve du pouvoir.','Thriller, Action, Romance, Science-Ficti',1997,'R',6.00,116.00,NULL,'local','gaeDE6zlslfhs1aTVsqs.jpg','6wzLT0gajTRhjxpqHzoj.jpg',12,1,'2020-05-31 08:02:00','2020-05-31 08:09:02'),('c7dc1b30-964c-11ea-96ba-77254d90ed8a','Vivarium','À la recherche de leur première maison, un jeune couple effectue une visite en compagnie d’un mystérieux agent immobilier et se retrouve pris au piège dans un étrange lotissement…','Thriller, Science-Fiction, Horreur',2019,'R',5.70,97.00,'https://www.youtube.com/watch?v=M9c72E7pEHQ','local','WeTDC5PdpHzvDPEAUoG7.jpg','fN3UvRKWkKeAGewzWJc1.jpg',13,1,'2020-05-14 23:38:30','2020-05-14 23:38:34'),('c87daf60-ac02-11ea-aab9-bbd5129d1533','Very Bad Trip 2','Phil, Stu, Alan et Doug s’offrent un voyage exotique en Thaïlande, à l’occasion du mariage de Stu. Après l’inoubliable soirée d’enterrement de sa vie de garçon à Las Vegas, Stu ne veut rien laisser au hasard et opte pour un brunch léger, sans risque, avant la cérémonie. Mais les choses ne se passent pas toujours comme prévu. Ce qui s\'est passé à Las Vegas est imaginable à Las Vegas, mais ce qui se passe à Bangkok dépasse l’imagination...','Comédie',2011,'R',6.40,102.00,'https://www.youtube.com/watch?v=MO1P45rOT8U','local','9Je2zYyqYpoyPTsPzIKq.jpg','6Loxj5aucV4P0SVbCVho.jpg',12,1,'2020-06-11 14:44:14','2020-06-11 14:44:17'),('c89bf330-9977-11ea-ad28-f76899c14cfb','Mortal Engines','Des centaines d’années après qu’un événement apocalyptique ait détruit la Terre, l’humanité s’est adaptée pour survivre en trouvant un nouveau mode de vie. Ainsi, de gigantesques villes mobiles errent sur Terre prenant sans pitié le pouvoir sur d’autres villes mobiles plus petites.  Tom Natsworthy - originaire du niveau inférieur de la grande ville mobile de Londres – se bat pour sa propre survie après sa mauvaise rencontre avec la dangereuse fugitive Hester Shaw. Deux personnages que tout oppose, qui n’étaient pas destinés à se croiser, vont alors former une alliance hors du commun, destinée à bouleverser le futur.','Fantasy',2018,'PG-13',6.10,128.00,'https://www.youtube.com/watch?v=gfROOihwT9g','local','XCm748baMXiu5PT79ikw.jpg','VrgNOv7OVjH5N8hy8pPb.jpg',10,1,'2020-05-19 00:23:53','2020-05-19 00:36:02'),('ca07ec50-8300-11ea-adcb-3d772cebb2ea','The Grudge','Le producteur Sam Raimi nous apporte une nouvelle version tortueuse de ce classique du genre, inspirée du film JU-ON : THE GRUDGE de Takashi Shimizu.','Horror',2020,'R',5.70,94.00,'https://www.youtube.com/watch?v=HaFKPQopo7w','local','m1Y9ZLnI4bg8CHwy6v01.jpg','7ByMFbFPQhf3fFY4VlGS.jpg',16,1,'2020-04-20 10:16:40','2020-05-13 00:53:19'),('ca1fc5f0-9c8f-11ea-85a5-21f5aa9a33eb','Destination Finale 5','Dans ce cinquième épisode, la Mort est toujours aussi omniprésente et se déchaîne après qu’un homme est victime d’une terrible prémonition, laquelle permet de sauver ses collègues de l’effondrement d’un pont suspendu. Ce groupe d’âmes innocentes n’était pas supposé survivre, et, dans une course terrifiante contre le temps, ces malheureux tentent frénétiquement de trouver le moyen d’échapper au sinistre agenda de la Mort.','Horror',2011,'R',6.00,95.00,'https://www.youtube.com/watch?v=C1gde41GG1s','local','102DNGiMrkS1cFA5YXPZ.jpg','SfuP47KFhFKAXAIPlGy6.jpg',12,1,'2020-05-22 22:53:17','2020-05-31 10:21:04'),('cb7a78e0-a36f-11ea-a8ea-e71ddcaa2cb3','Ace Ventura en Afrique','Parce qu\'il n\'a pu sauver un raton laveur perdu en haute montagne, Ace Ventura s\'est retiré dans une lamaserie au Tibet. Mais, à la faveur d\'une nouvelle mission, Ace Ventura part en Afrique mettre la main sur une chauve-souris blanche sacrée disparue avant qu\'un conflit n\'éclate entre les tribus Wachati et Wachootoo. Le début d\'Ace Ventura en Afrique est fortement inspiré de l\'histoire de Cliffhanger : Traque au sommet.','Comedy',1995,'PG-13',6.30,91.00,'null','local','4gefjLkLy4P7VXvvv8SY.jpg','osgiXvDmHEJRknBSVXOG.jpg',12,1,'2020-05-31 16:51:53','2020-05-31 16:52:36'),('cbc1ef20-b02c-11ea-8bb4-fd8d92b50ccd','Apocalypto','Dans les temps turbulents précédant la chute de la légendaire civilisation Maya. Jeune père porteur de grandes espérances, chef de son petit village, Patte de Jaguar vit une existence idyllique brusquement perturbée par une violente invasion. Capturé et emmené lors d\'un périlleux voyage à travers la jungle pour être offert en sacrifice aux Dieux de la Cité Maya, il découvre un monde régi par la peur et l\'oppression, dans lequel une fin déchirante l\'attend inéluctablement. Poussé par l\'amour qu\'il porte à sa femme, à sa famille et à son peuple, il devra affronter ses plus grandes peurs en une tentative désespérée pour retourner chez lui et tenter de sauver ce qui lui tient le plus à cœur.','Action, Aventure, Drame, Thriller',2006,'R',7.50,132.00,'https://www.youtube.com/watch?v=6diXYIwIXFE','local','IFsbKFyqh5UiHjiD1iMk.jpg','wgTwF5VVaQGTaBZ6U6KI.jpg',12,1,'2020-06-16 21:55:03','2020-06-16 21:55:07'),('cbd3d560-aa8a-11ea-8461-85e10c16579e','L\'élève Ducobu','L’élève Ducobu s’est encore fait renvoyer d’une école. Cette fois, pour éviter de finir en pension, il n’a plus qu’une seule chance : réussir à Saint-Potache. Pour s’en sortir, ce cancre attachant va devoir se surpasser et mettre au point les tricheries les plus ingénieuses et les plus spectaculaires jamais imaginées. La partie est loin d’être gagnée car Mr Latouche, son redoutable professeur, est un adversaire coriace et Léonie, la première de la classe sur qui il tente de copier, ne va pas rester longtemps sous son charme…','Comédie',2011,'PG-13',4.90,96.00,'https://www.youtube.com/watch?v=ldD4ROMphi4','local','nRaDh1K4IZkEmXkvmMJf.jpg','n2cN41oqtpa3beikv5B3.jpg',10,1,'2020-06-09 17:52:49','2020-06-09 17:52:55'),('cc313b50-821d-11ea-8960-37ef9c8bee24','Bad Boys for Life','Marcus Burnett est maintenant inspecteur de police. Mike Lowery est, quant à lui, en pleine crise de la quarantaine. Ils s\'unissent à nouveau lorsqu\'un mercenaire albanais, dont ils ont tué le frère, leur promet une importante prime.','Thriller, Action, Crime',2020,'R',7.20,124.00,'https://www.youtube.com/watch?v=a-pOG1ylwnY','local','tigkcINg9gh0diCpddc6.jpg','arCiscPePwosUtSLa991.jpg',16,1,'2020-04-19 07:11:47','2020-04-19 07:11:59'),('cd35e510-a65f-11ea-a389-d7621e5e3396','Equalizer 2','Robert McCall sert inlassablement la justice au nom des exploités et des opprimés. Mais jusqu’où est-il prêt à aller lorsque cela touche quelqu’un qu’il aime ?','Thriller, Action, Crime',2018,'R',6.50,120.00,'https://www.youtube.com/watch?v=wpXUiD38_X0','local','MYER9J0TKmQ8v36TFGW2.jpg','ZOtuKwBa6hMHRgLt8vdW.jpg',16,1,'2020-06-04 10:34:58','2020-06-04 10:35:02'),('cedbb410-a3f9-11ea-8a8d-4d08c42f83fe','Fast & Furious : Hobbs & Shaw','Depuis que Hobbs, fidèle agent de sécurité au service diplomatique des États-Unis, combatif mais droit, et Shaw, un homme sans foi ni loi, ancien membre de l’élite militaire britannique, se sont affrontés en 2015 dans Fast & Furious 7, les deux hommes font tout ce qu’ils peuvent pour se nuire l’un à l’autre. Mais lorsque Brixton, un anarchiste génétiquement modifié, met la main sur une arme de destruction massive après avoir battu le meilleur agent du MI6 qui se trouve être la sœur de Shaw, les deux ennemis de longue date vont devoir alors faire équipe pour faire tomber le seul adversaire capable de les anéantir.','Action, Aventure, Comédie',2019,'PG-13',6.80,137.00,'https://www.youtube.com/watch?v=VZFp6OIeX2Q','local','e806VVu6wVDf5NCrBTmO.jpg','4RgpkLEyj3GReNZjFhkZ.jpg',16,1,'2020-06-01 09:19:50','2020-06-01 09:19:54'),('cf58a4a0-8169-11ea-b603-df07fe7a11a6','La Voie de la justice','Le combat historique du jeune avocat Bryan Stevenson. Après ses études à l’université de Harvard, Bryan Stevenson aurait pu se lancer dans une carrière des plus lucratives. Il décide pourtant de se rendre en Alabama pour défendre ceux qui ont été condamnés à tort, avec le soutien d’une militante locale, Eva Ansley. Un de ses premiers cas - le plus incendiaire - est celui de Walter McMillian qui, en 1987, est condamné à mort pour le meurtre retentissant d’une jeune fille de 18 ans. Et ce en dépit d’un grand nombre de preuves attestant de son innocence et d’un unique témoignage à son encontre provenant d’un criminel aux motivations douteuses. Au fil des années, Bryan se retrouve empêtré dans un imbroglio de manœuvres juridiques et politiques. Il doit aussi faire face à un racisme manifeste et intransigeant alors qu’il se bat pour Walter et d’autres comme lui au sein d’un système hostile.','Drama,Thriller',2019,'PG-13',8.10,137.00,'https://www.youtube.com/watch?v=Lr9QW7MZRzs','local','hfZa5C8JWZjDG1pWXx1O.jpg','px4CnrPyS9RbP96mLUMk.jpg',15,1,'2020-04-18 09:43:23','2020-04-18 09:45:24'),('d06cf8c0-aa65-11ea-af81-35f52e7e8fb2','Hala','Hala, jeune adolescente musulmane, regarde sa famille se dissoudre tandis qu\'elle se découvre.','Drame',2019,'R',6.20,93.00,NULL,'local','YO2Fa7PTCrYKogQmyuMI.jpg','QHDyqNwxqwXkzDKe2zqa.jpg',15,1,'2020-06-09 13:28:05','2020-06-09 13:28:10'),('d1e16cd0-ac13-11ea-938e-ff9991079d09','The Town','Doug MacRay est un criminel impénitent, le leader de facto d’une impitoyable bande de braqueurs de banque qui s’enorgueillit de voler à leur gré sans se faire prendre. Sans attaches particulières, Doug ne craint jamais la perte d’un être cher. Mais tout va changer le jour où, lors du dernier casse de la bande, ils prennent en otage la directrice de la banque, Claire Keesey. Bien qu’ils l’aient relâchée indemne, Claire est nerveuse car elle sait que les voleurs connaissent son nom…et savent où elle habite. Mais elle baisse la garde le jour où elle rencontre un homme discret et plutôt charmant du nom de Doug….ne réalisant pas qu’il est celui qui, quelques jours plus tôt, l’avait terrorisée. L’attraction instantanée entre eux va se transformer graduellement en une romance passionnée qui menacera de les entraîner tous deux sur un chemin dangereux et potentiellement mortel.','Thriller',2010,'R',7.20,123.00,'https://www.youtube.com/watch?v=OaOldOXUIqY','local','qLE6jXwdd3qiaDGjQI1y.jpg','cIbj6Bf0z9oSNNkAuPZa.jpg',16,1,'2020-06-11 16:46:11','2020-06-11 16:49:32'),('d2567db0-898e-11ea-8506-91c62586937a','Le Parrain','En 1945, à New York, les Corleone sont une des cinq familles de la mafia. Don Vito Corleone, \"parrain\" de cette famille, marie sa fille à un bookmaker. Sollozzo, \" parrain \" de la famille Tattaglia, propose à Don Vito une association dans le trafic de drogue, mais celui-ci refuse. Sonny, un de ses fils, y est quant à lui favorable.  Afin de traiter avec Sonny, Sollozzo tente de faire tuer Don Vito, mais celui-ci en réchappe. Michael, le frère cadet de Sonny, recherche alors les commanditaires de l\'attentat et tue Sollozzo et le chef de la police, en représailles.  Michael part alors en Sicile, où il épouse Apollonia, mais celle-ci est assassinée à sa place. De retour à New York, Michael épouse Kay Adams et se prépare à devenir le successeur de son père...','Drama',1972,'R',8.70,177.00,'https://www.youtube.com/watch?v=ktCk487JeMw','local','wxssRRbbaHRZCePTfFl2.jpg','iyTIjgSfac6dEVGduvSC.jpg',12,1,'2020-04-28 18:28:29','2020-04-28 18:29:11'),('d294e390-821f-11ea-a371-6f98ff28d862','Bloodshot','Ray Garrison un soldat mort au combat ressuscité par l\'entrepreneur en armement Rising Spirit Technologies grâce à la nanotechnologie. Souffrant d\'une perte totale de mémoire mais désormais doté de toute une gamme de nouvelles capacités, Ray a du mal à renouer avec qui il était tout en apprenant quelle sorte d\'arme il est devenu... Aidé par une équipe de camarades combattants augmentés sous le nom de code Chainsaw.','Action, Science-Fiction',2020,'PG-13',7.20,110.00,'https://www.youtube.com/watch?v=CPS9IKSid4w','local','Zd2mtZn8yUp3n234ilc1.jpg','S54f6wJHtzm0vLZQ19dh.jpg',13,1,'2020-04-19 07:26:17','2020-04-19 07:26:20'),('d2ef6cb0-8221-11ea-98b5-4911a26741c4','Uncut Gems','Un propriétaire de bijouterie, au sein de Diamond District à New York, et revendeur à ses heures perdues, voit sa vie bouleversée lorsque sa marchandise est volée.','Drama',2019,'R',7.20,135.00,'https://www.youtube.com/watch?v=DG6u1K62evk','local','serY8GVyP0a8rCaSeOpi.jpg','GlzeTkYXooQZXhcmBn8Z.jpg',15,1,'2020-04-19 07:40:37','2020-04-19 07:40:56'),('d33010b0-a3f7-11ea-8f67-2b03e3ea3e12','xXx 2 : The Next Level','Un complot se trame au cœur de la Maison Blanche. La plus haute autorité du pays est en danger. Augustus Gibbons vient lui-même d\'échapper à un attentat au sein du quartier général secret de la NSA. Plus personne n\'est en sécurité… Pour l\'aider à déjouer la machination, Gibbons a besoin d\'un nouvel agent xXx. Pour lui, un seul homme peut mener à bien cette mission : Darius Stone, un soldat d\'élite décoré des Forces Spéciales, un dur venu du ghetto, expert en armement et en techniques de combat, et une forte tête... Pour le moment, Stone est détenu sous bonne garde dans une prison militaire. Mais les enjeux n\'ont jamais été aussi élevés, et Gibbons sait que cet homme est l\'unique espoir de la nation…','Action, Aventure, Crime, Drame, Mystère,',2005,'R',4.90,101.00,'https://www.youtube.com/watch?v=kCjtaspya0A','local','eQzkDmtcJYeV5KwoVjrZ.jpg','MINumO4eXIDXzI7z7ed6.jpg',12,1,'2020-06-01 09:05:38','2020-06-01 09:07:24'),('d4280b00-8207-11ea-8a8a-3d2561dfc0aa','La Chute du Président','Victime d’un coup monté, Mike Banning, agent des services secrets, est accusé d’être le cerveau d’une tentative d’assassinat envers le président américain, Allan Trumbull. Poursuivi par le FBI, il va devoir combattre pour survivre et trouver l’identité de celui qui menace la vie du président…','Action, Thriller',2019,'R',6.20,122.00,'https://www.youtube.com/watch?v=j6PUJVc_rI8','local','5w9e0SfVuAamuTsbdPlu.jpg','wSRQSwC7sAwDbS6duF7M.jpg',16,1,'2020-04-19 04:34:32','2020-04-19 04:34:36'),('d4f44ed0-a741-11ea-802d-b1e6793f0e25','6 Days','En avril 1980, un commando de 6 soldats iraniens du Khouzistan opposés à la République islamique fait irruption à l\'Ambassade d\'Iran de Londres et prend les personnes présentes en otage. Ils réclament la libération de 91 prisonners, mais le Président refus