us que serrée…','Aventure, Fantastique, Science-Fiction',2020,'PG',5.10,95.00,'https://www.youtube.com/watch?v=Hsr_1cumcn8','local','j4qly46iTm9bexppRWFO.jpg','4DMQ1WLlp8a84eahkgRE.jpg',10,1,'2020-06-13 16:22:28','2020-06-13 16:22:36'),('d652f810-8204-11ea-abfe-d7a73bc86e31','Parasite','Toute la famille de Ki-taek est au chômage. Elle s’intéresse particulièrement au train de vie de la richissime famille Park. Mais un incident se produit et les 2 familles se retrouvent mêlées, sans le savoir, à une bien étrange histoire…','Comédie, Thriller, Drame',2019,'R',8.50,135.00,'https://www.youtube.com/watch?v=3LYiLq4EHjA','local','Vv2qHlCi8NAUw72KXgV0.jpg','fqj5PqrBcCIfSSuSV3oh.jpg',15,1,'2020-04-19 04:13:07','2020-04-19 04:13:11'),('d66fc9a0-a3f6-11ea-bbf6-9d9c8544bb4e','Forrest Gump','Forrest Gump est le symbole d\'une époque, un candide dans une Amérique qui a perdu son innocence. Merveilleusement interprété par Tom Hanks, Forrest vit une série d\'aventures, de l\'état d\'handicapé physique à celui de star du football, de héros du Vietnam au roi de la crevette, des honneurs de la Maison Blanche au bonheur d\'une grande histoire d\'amour. Son cœur dépasse les limites de son Q.I.','Romance',1994,'PG-13',8.40,142.00,'https://www.youtube.com/watch?v=qlx0JTy3LL8','local','0eEA9TiwBS8mELbWwE0D.jpg','PqHM6EdQiN10FJmWtU7T.jpg',12,1,'2020-06-01 08:58:34','2020-06-01 09:07:23'),('d69d6990-ada3-11ea-8e77-6566ee2d0db6','L\'Interview qui tue !','Dave Skylark anime le talk-show \"Skylark Tonight\" au cours duquel il interviewe des célébrités sur des sujets intimes. Alors que Dave et son équipe fêtent leur 1 000e épisode, ils découvrent que le dirigeant nord-coréen Kim Jong-un est un fan de leur émission, ce qui incite le producteur du spectacle Aaron Rapoport à lui proposer une interview. Cependant l\'agent de la CIA Lacey propose à Dave et Aaron d\'assassiner Kim pour faciliter un coup d\'État. Ces derniers acceptent à contrecœur. Arrivés en Corée du Nord, ils s\'apercevront que tout 