1:59:03'),('d9e8c5f0-a9ae-11ea-9bd5-03a663852ee7','La Belle et la Bête','Une nouvelle adaptation live du conte \"La Belle et la Bête\".  Belle, jeune fille rêveuse et passionnée de littérature, vit avec son père, un vieil inventeur farfelu. S\'étant perdu une nuit dans la fôret, ce dernier se réfugie au château de la Bête, qui la jette au cachot. Ne pouvant supporter de voir son père emprisonné, Belle accepte alors de prendre sa place, ignorant que sous le masque du monstre se cache un Prince Charmant tremblant d\'amour pour elle, mais victime d\'une terrible malédiction.','Familial, Fantastique, Romance',2017,'PG',6.90,129.00,'https://www.youtube.com/watch?v=PHfN2KW-lbA','local','6mAVSqbr8WhtAi1aTXNT.jpg','Fz0mPd1RCuhhGUvVDvGv.jpg',10,1,'2020-06-08 15:38:23','2020-06-08 15:38:27'),('db7fcf90-aa53-11ea-ba71-4bfa6ca2c00c','Manipulations','Ben est un jeune et ambitieux avocat travaillant pour le cabinet dirigé par Abrams. Il se met en tête d\'attaquer le puissant dirigeant d\'un important groupe pharmaceutique et se retrouve alors impliqué dans une spirale de chantage et de corruption. Une entrée brutale dans la cour des grands dont il ne pourra se sortir indemne...','Drame, Thriller, Mystère',2016,'R',5.50,106.00,'https://www.youtube.com/watch?v=xgVd4-Siqqw','local','NIMzoQS9lE5AJj529Aul.jpg','ZGdWu9gCSubeLpryvYrg.jpg',15,1,'2020-06-09 11:19:32','2020-06-09 11:19:36'),('dd8af140-821e-11ea-ac13-3f9aa6f45356','Spenser Confidential','Spenser, un ancien flic, replonge dans les bas-fonds de Boston lorsqu\'il découvre la vérité sur un complot retors et un meurtre qui a défrayé la chronique. Malgré des menaces répétées, Spenser décide de prendre l\'affaire en main pour prouver que personne n\'est au-dessus des lois.','Action, Comédie, Thriller',2020,'R',6.70,110.00,'https://www.youtube.com/watch?v=L6PIxcUwu-s','local','qPm7fL92aJtRESXT13pv.jpg','peNVqF0XVlzBCAOVayGt.jpg',16,1,'2020-04-19 07:19:26','2020-04-19 07:20:25'),('de2b5160-a660-11ea-a4b5-3756e93ec15b','Pirates des Caraïbes : La Vengeance de Salazar','Jack Sparrow et ses compagnons se lancent dans la quête du Trident de Poséidon, sur lequel le Capitaine Teague détient des informations précieuses. Cet artefact légendaire, qui donne tous les pouvoirs sur les océans, est leur seul moyen d\'échapper aux fantômes du redoutable Capitaine Salazar, échappés du Triangle des Bermudes pour éliminer tous les pirates des océans.','Aventure, Action, Fantastique, Comédie',2017,'PG-13',6.60,129.00,'https://www.youtube.com/watch?v=64cud23WLys','local','bM2ZZGoY9ALlFSQ7JcW5.jpg','AGdsWOKQYkiptc9VVAxp.jpg',16,1,'2020-06-04 10:42:36','2020-06-04 10:42:40'),('df0785e0-8202-11ea-a629-1b4b7da7108d','My Hero Academia : Two Heroes','Les examens finaux sont enfin terminés, et les élèves de Yuei se préparent pour le camp d’été. Izuku et All Might reçoivent une invitation d’une certaine personne pour partir à l’étranger dans une immense ville ambulante appelée « I-Island ». Dans cette île qui regroupe les connaissances de scientifiques du monde entier, se tient l’I-Expo, un événement dédié aux résultats de recherches sur les Alters et les superhéros. Izuku y fait la rencontre de Melissa, une fille sans Alter qui lui rappelle son passé. Soudain, l’imprenable système de sécurité de l’île est piraté par des vilains, et tous les habitants de l’ile se retrouvent pris en otage. Un plan capable d’ébranler la société des héros est en marche ! Et la personne au coeur de tout cela, est le héro numéro 1 et symbole de la paix : All Might.','Animation, Action, Com,die, Fantastique,',2018,'G',7.90,95.00,'https://www.youtube.com/watch?v=_40qaPSnfW0','local','YXLYiGJa7UhrBoeYuhYP.jpg','0T3qxPJ4FTJlGwYkeYdf.jpg',8,1,'2020-04-19 03:59:03','2020-06-14 18:45:23'),('dff16990-b02b-11ea-9da5-5b8d11b510aa','Tom et Jerry au pays de Charlie et la chocolaterie','Le petit Charlie rêve de gagner le billet qui lui fera passer une journée dans la confiserie de Willy Wonka. Tom et Jerry vont l\'accompagner dans cette aventure et empêche