er, ils sont armés et fascinés par la criminalité. Ils ne craignent ni la prison ni la mort, seulement de mener une vie ordinaire comme leurs parents. Leurs modèles : les parrains de la Camorra. Leurs valeurs : l’argent et le pouvoir. Leurs règles : fréquenter les bonnes personnes, trafiquer dans les bons endroits, et occuper la place laissée vacante par les anciens mafieux pour conquérir les quartiers de Naples, quel qu’en soit le prix.','Thriller',2019,'R',6.80,112.00,'https://www.youtube.com/watch?v=vdO5GAorb2o','local','apLGkVDoJQWbvxCX2dQi.jpg','Q3Mcqc5lfBE4xPe6Fx1H.jpg',15,1,'2020-04-28 18:21:49','2020-04-28 18:22:30'),('e42741c0-94b8-11ea-af8c-771310c1671c','Sully','Le 15 janvier 2009, l\'incroyable se produit : un avion qui vient de subir une terrible avarie réussit à se poser sans encombre sur les eaux glacées du fleuve Hudson, au large de Manhattan. Bilan : les 155 passagers ont la vie sauve ! Un exploit hors du commun accompli par le commandant « Sully » Sullenberger et bientôt relayé par les médias et l\'opinion publique. Partout dans le pays, la presse s\'empare du « miracle sur l\'Hudson ». Et pourtant, alors même que le pilote est salué comme un héros, une enquête est diligentée qui menace sa réputation et sa carrière…','History',2016,'PG-13',7.10,106.00,'https://www.youtube.com/watch?v=nnM8aoJv-f8','local','MoOH8rPOFNlmDaGeIJrX.jpg','YCJjAGgctOKFCQzc0NS1.jpg',15,1,'2020-05-12 23:27:21','2020-05-12 23:27:41'),('e44dc920-8205-11ea-beef-1fea2a901ba4','Le Mans 66','Relate l’histoire vraie qui a conduit l’ingénieur automobile visionnaire américain Caroll Shelby à faire équipe avec le pilote de course britannique surdoué Ken Miles. Bravant l’ordre établi, défiant les lois de la physique et luttant contre leurs propres démons, les deux hommes n’avaient qu’un seul but: construire pour le compte de Ford Motor Company un bolide révolutionnaire capable de renverser la suprématie de l’écurie d’Enzo Ferrari sur le mythique circuit des 24 heures du Mans en 1966…',