ww.youtube.com/watch?v=oEtUcPl7i44','local','AiVVlUsUp6RN4RdwBzHm.jpg','dRBhBbN2EkAm2OiNFwyx.jpg',13,1,'2020-05-19 00:25:03','2020-05-19 00:36:02'),('f352f470-8200-11ea-9f59-715df657377d','Running with the devil','Lorsqu’une cargaison de coca est compromise, à la consternation du chef du cartel, il commande à un autre grand trafiquant de poursuivre la chaîne d’approvisionnement. Nous suivons un homme et son épouse, ainsi que ses enfants, dans cette expédition à travers les frontières internationales.','Thriller, Drame, Crime',2019,'R',5.10,100.00,'null','local','KcvMM6CkwCuDmJ8UT4Fl.jpg','Rgx5zoI2OPHIfP9iJvn2.jpg',15,1,'2020-04-19 03:45:18','2020-04-19 03:45:30'),('f5c9fa30-b042-11ea-bf86-ab299c96675a','Tom Et Jerry Collection Vol 2','Les épisodes mettent en scène le duo Tom et Jerry','Animation, Familial',1976,'G',6.10,80.00,'null','local','m8YdhqSusAyNYnoufs0j.jpg','5so630DzXfu3AjS2342U.jpg',14,1,'2020-06-17 00:33:42','2020-06-17 00:36:14'),('f7a55ea0-aa4e-11ea-97d8-934f375d8cbd','Les Huit Salopards','Après la Guerre de Sécession, huit voyageurs se retrouvent coincés dans un refuge au milieu des montagnes. Alors que la tempête s\'abat au-dessus du massif, ils réalisent qu\'ils n\'arriveront peut-être pas à rallier Red Rock comme prévu...','Mystery,Western',2015,'R',7.70,180.00,'https://www.youtube.com/watch?v=JoLvEad4-aM','local','eHWT4vkTx4nm2XyHIvOq.jpg','WAgLzwPfXs6hY19ToiRJ.jpg',15,1,'2020-06-09 10:44:32','2020-06-09 10:44:58'),('f9846f90-a324-11ea-943c-2f1803737892','Le Parrain : 2ème partie','Depuis la mort de Don Vito Corleone, son fils Michael règne sur la famille. Amené à  négocier avec la mafia juive, il perd alors le soutien d\'un de ses lieutenants, Frankie Pentageli. Échappant de justesse à un attentat, Michael tente de retrouver le coupable.','Drame, Crime',1974,'R',8.60,202.00,'https://www.youtube.com/watch?v=qJr92K_hKl0','local','FqnVoD1GzUDyoPW0JSs8.jpg','metaJORqB2nZjjezGLlg.jpg',12,1,'2020-05-31 07:56:18','2020-05-31 07:56:39'),('fc3a1cb0-aa4d-11ea-947a-d9c584e38997','American Gangster','Début des années 1970, New York. Frank Lucas a vécu pendant vingt ans dans l\'ombre du Parrain noir de Harlem, Bumpy Johnson, qui en fait son garde du corps et confident. Lorsque son patron succombe à une crise cardiaque, Lucas assure discrètement la relève et ne tarde pas à révéler son leadership, son sens aigu des affaires et son extrême prudence, en prenant pour auxiliaires ses frères et cousins et en gardant un profil bas. Inconnu de la police comme des hautes instances de la Cosa Nostra, Lucas organise avec la complicité d\'officiers basés au Vietnam un véritable pont aérien et importe ainsi par avions entiers des centaines de kilos d\'héroïne pure, qu\'il revend à bas prix dans les rues de New York...','Drama',2007,'R',7.60,157.00,'https://www.youtube.com/watch?v=z3XMvLtPqSA','local','Y5gabBVAdTqrNJCASxM9.jpg','34pO2n2AaWryMUU3XJxw.jpg',15,1,'2020-06-09 10:37:30','2020-06-09 10:37:45'),('fcdb5fe0-a3f7-11ea-9ea6-17c6c5d955c4','xXx : Reactivated','Xander Cage, sportif de l’extrême devenu agent d\'élite, sort de l’exil qu’il s’était imposé, pour affronter le redoutable guerrier Alpha Xiang et son équipe. Il entre dans une course impitoyable afin de récupérer une arme de destruction massive connue sous le nom de Boîte de Pandore. Recrutant une toute nouvelle équipe d’experts accros à l\'adrénaline, Xander se retrouve au cœur d’une conspiration menaçant les gouvernements les plus puissants du monde.','Action, Aventure, Crime',2017,'R',5.70,107.00,'https://www.youtube.com/watch?v=dpSuRGDGzRo','local','owVMdGnjQ60C9BBpRZa4.jpg','Fnv8u3hiloOLuwOgc1ht.jpg',12,1,'2020-06-01 09:06:48','2020-06-01 09:07:24'),('fe5321c0-9bc0-11ea-bd0d-b37569519391','For Love or Money','Mark a une vie de rêve : il est sur le point de devenir multimillionnaire et d’épouser son amour de jeunesse, Connie. Mais les choses ne sont parfaites qu’en surface : Mark découvre par hasard que Connie ne l’aime pas et compte juste voler sa fortune une fois le mariage prononcé. Qu’à cela ne tienne : Mark échafaude son propre plan pour voir jusqu’où Connie sera prête à aller pour mettre la main sur son argent…','Comedy',2020,'R',5.70,95.00,'null','local','N7sUIYNF9p84QAfrD3Fa.jpg','ou6am73tgLoT4rpcV4MT.jpg',10,1,'2020-05-21 22:12:59','2020-05-21 22:21:18'),('ff7154a0-a3f6-11ea-a9b2-e5b251d2e3f3','Seven','Pour conclure sa carrière, l\'inspecteur Somerset, vieux flic blasé, tombe à sept jours de la retraite sur un criminel peu ordinaire. John Doe, c\'est ainsi que se fait appeler l\'assassin, a décidé de nettoyer la société des maux qui la rongent en commettant sept meurtres basés sur les sept péchés capitaux : la gourmandise, l\'avarice, la paresse, l\'orgueil, la luxure, l\'envie et la colère.','Thriller',1995,'R',8.30,130.00,'https://www.youtube.com/watch?v=BLY4treE0XU','local','sXxjMmqH4wIoAD0zpNBv.jpg','oW0mo25aWysoManaK1vo.jpg',12,1,'2020-06-01 08:59:43','2020-06-01 09:07:23');
