INSERT INTO `series` VALUES ('010877a0-82d1-11ea-8ec2-d35a4b1bc125',76479,'The Boys','Dans un monde fictif où les super-héros se sont laissés corrompre par la célébrité et la gloire, une équipe de justiciers qui se fait appeler \"The Boys\" décide de passer à l\'action et d\'abattre ces super-héros autrefois appréciés de tous.','Sci-Fi',2019,'PG-13',8.20,'local','HP0f6k2OBV6QqnZ3kHaj.jpg',4,'RllAW7B5wWnKu2Yit3gU.jpg','2020-04-20 04:34:36','2020-04-20 04:48:21'),('015225b0-a36e-11ea-a643-e59241bb58a4',87050,'Hollywood','Dans le Hollywood de l\'après-Deuxième Guerre mondiale, un groupe de jeunes acteurs et cinéastes pleins d\'ambition ne recule devant rien pour percer dans le showbiz.','Drame',2020,'PG-13',7.60,'local','2SnohG2T1a1RqDMSlMww.jpg',2,'a8yPd3KJ3XE1lh3zgjXk.jpg','2020-05-31 16:39:05','2020-05-31 16:39:05'),('01795ff0-7393-11ea-8492-1f1602745c34',78191,'YOU','Obsédé par une étudiante rêvant de devenir auteur, un charmant libraire tente par tous les moyens de s\'immiscer dans la vie de la jeune femme.','Thriller',2018,'PG-13',8.00,'local','Wh7c86z3uXo9smrb5Cid.jpg',11,'J2pTAEWSii9lObVO9AD4.jpg','2020-03-31 19:03:01','2020-04-11 17:43:37'),('04a0f850-7df2-11ea-8679-1fecaf0c9445',42009,'Black Mirror','Chaque épisode de cette anthologie montre la dépendance des hommes vis-à-vis de tout ce qui a un écran...','Fantasy',2011,'PG',8.30,'local','7QK8ZOM5SfJwomRbBJed.jpg',4,'jxYwDYEuU3xQcbTTQlbK.jpg','2020-04-13 23:48:20','2020-04-13 23:48:31'),('04fdcc50-9261-11ea-95d5-f72c4a4054cd',83872,'Beat','Promoteur de club branché de la scène techno berlinoise, Robert Schlag, surnommé \"Beat\", est recruté comme indic par les services de renseignement européens pour atteindre les commanditaires d\'un réseau criminel. À la recherche des cerveaux d\'un traffic d','Drama',2018,'R',7.70,'local','Tup9ATXiuwDoTLNNi94Z.jpg',2,'AIo97BGTfMi0Qf1GEsG0.jpg','2020-05-09 23:53:18','2020-05-10 21:49:14'),('0979f610-79bd-11ea-88cf-2920b3e97de0',61068,'Gomorra - La serie','Patriarche de la f